import React from 'react';
import Sketch from "react-p5";
import p5Types from "p5";
import './Dashboard.css';

export default function Dashboard()
{
  const   width = 1300;
	const height = 600;

  const setup = (p5: p5Types, canvasParentRef: Element) => {
		p5.createCanvas(width, height).parent(canvasParentRef);
	};
  let x = 50;

	const draw = (p5: p5Types) => {
		p5.background('#222222')
		// p5.ellipse(x, y, 90, 90);
		// x++;
    // Draw a square at location (30, 20) with a side size of 55.
    p5.square(0, 0, 20);
    // p5.describe('white square with black outline and round edges of different radii');


    for (let i = 0; i < 1300; i+=20) {
      p5.line(i, 0, i, 1300);
    }
    for (let i = 0; i < 600; i+=20) {
      p5.line(0, i, 1300, i);
    }

    p5.background(0, 0, 93);
    p5.fill(0);

    p5.rect(p5.movedX, p5.movedY, 80, 50);

    // p5.describe(
    //   'a 78 pixels long line running from mid-top to bottom-right of canvas'
    // );



	};
  // const ssetup = (p5: any, canvasParentRef : Element) => {
  //   cnv = p5.createCanvas(x, y).parent(canvasParentRef)
  //   cnv.mousePressed((event) => {
  //     console.log("Clicked on the canvas. Event:", event)
  //   })
  // }

  return(
    <div className='board'>
      {/* <h1>Dashboard</h1> */}
      <Sketch setup={setup} draw={draw} />
    </div>
  )
}

